import React from 'react';

const CharacterGrid = ({items, isLoading}) => {
  return isLoading ? ( <h1 className= 'text-white-700 text-base '>Loading...</h1>) : (<section className= "grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 xl:grid-cols-6">
      {items.map((item) => (
      <h1 >{item.name}</h1>
      ))}
  </section>
  )
};

export default CharacterGrid;
